// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

contract SeguroMedico {

    struct Seguro {
        uint256 fechaInicio;
        uint256 fechaVencimiento;
        bool activo;
        address paciente;
        uint256[] historialRenovaciones; // Array para registrar fechas de renovaciones
    }

    mapping(address => Seguro) public seguros;

    // Crear un seguro médico
    function crearSeguro(uint256 _duracion) external {
        require(seguros[msg.sender].activo == false, "Ya tienes un seguro activo.");

        uint256 fechaInicio = block.timestamp;
        uint256 fechaVencimiento = fechaInicio + _duracion;

        seguros[msg.sender] = Seguro({
            fechaInicio: fechaInicio,
            fechaVencimiento: fechaVencimiento,
            activo: true,
            paciente: msg.sender,
            historialRenovaciones: new uint256[](0) // Crear un array vacío sin necesidad de inicializarlo
        });
    }

    // Verificar si el seguro está activo
    function esSeguroActivo(address _paciente) external view returns (bool) {
        Seguro memory seguro = seguros[_paciente];
        return seguro.activo && block.timestamp < seguro.fechaVencimiento;
    }

    // Renovar el seguro
    function renovarSeguro(uint256 _duracion) external {
        require(seguros[msg.sender].activo == true, "No tienes un seguro activo.");

        // Agregar la fecha de renovación al historial
        seguros[msg.sender].historialRenovaciones.push(block.timestamp);

        // Actualizar la fecha de vencimiento
        seguros[msg.sender].fechaVencimiento += _duracion;
    }

    // Cancelar seguro
    function cancelarSeguro() external {
        seguros[msg.sender].activo = false;
    }

    // Consultar historial de renovaciones
    function consultarHistorialRenovaciones(address _paciente) external view returns (uint256[] memory) {
        return seguros[_paciente].historialRenovaciones;
    }
}

